INSERT INTO `tb_pertanyaan_14` VALUES ('U10', 'Apakah anda pernah melakukan transaksi pelayanan\r\npublik selain di MPP ? Misalnya mengurus KIA di\r\nDukcapil, mengurus perpanjangan SKCK di Polres, dsb.\r', '-', '-', 'Ya', 'Tidak', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U11', 'Menurut Saudara, bagaimana pelayanan di MPP jika\r\ndibandingkan dengan pelayanan pada Unit Pelayanan Publik yang pernah anda datangi ?\r', 'Lebih buruk', 'Sama Saja', 'Lebih Baik', 'Diatas ekspektasi\r', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U12', 'Sudah berapa kali anda bertransaksi pelayanan publik di MPP sejak MPP ini berdiri ?\r', 'Baru 1x', '2x', '3x', 'Lebih dari 3x', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U13', 'Bagaimana kemudahan persyaratan pelayanan di MPP?', 'Tidak mudah\r', 'Kurang Mudah', 'Mudah', 'Sangat Mudah', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U14', 'Bagaimana kemudahan prosedur pelayanan di MPP?', 'Tidak mudah\r', 'Kurang Mudah', 'Mudah', 'Sangat Mudah', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U15', 'Bagaimana kesigapan petugas pelayanan di MPP?', 'Tidak sigap', 'Kurang sigap', 'Sigap', 'Sangat Sigap', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U16', 'Bagaimana kerapihan dan keramahan petugas\r\npelayanan?', 'Tidak rapih dan ramah\r', 'Cukup rapih dan ramah\r', 'Rapih dan ramah', 'Sangat rapih dan ramah\r', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U17', 'Bagaimana kenyamanan tempat parkiran di MPP?', 'Tidak Nyaman', 'Kurang Nyaman', 'Nyaman', 'Sangat Nyaman', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U18', 'Bagaimana kenyamanan ruang tunggu di MPP?', 'Tidak Nyaman', 'Kurang Nyaman', 'Nyaman', 'Sangat Nyaman', 'Khusus Serentak');
INSERT INTO `tb_pertanyaan_14` VALUES ('U19', 'Bagaimana kenyamanan loket pelayanan di MPP?', 'Tidak Nyaman', 'Kurang Nyaman', 'Nyaman', 'Sangat Nyaman', 'Khusus Serentak');
