INSERT INTO `tb_pertanyaan_14` VALUES ('U21', 'Bagaimana kelengkapan dan kenyaman sarpras\r\npenunjang (ruang laktasi, tempat bermain anak, tempat\r\nfotocopy, kantin, ruang pengaduan, atm dll) yang ada di\r\nMPP?', 'Tidak Ada', 'Ada tetapi tidak berfungsi atau belum lengkap', 'Lengkap namun berfungsi kurang maksimal', 'Lengkap dan dikelola dengan baik', 'Khusus Serentak');
